function rot13(str) { // LBH QVQ VG!
  // A = 65  / B = 90
  var arr = str.split('');
  arr = arr.map(function (e) {
    var idx = e.charCodeAt(0);
    if (idx < 65 || idx > 90) {
      return e;
    }
    idx = (idx - 52) % 26;
    return String.fromCharCode(idx + 65);
  });
  return arr.join('');
}

