var lookup = (function (H) {
  H = JSON.parse(
    '{"PENNY":1,"NICKEL":5,"DIME":10,"QUARTER":25,"ONE":100,"FIVE":500,"TEN":1e3,"TWENTY":2e3,"ONE HUNDRED":1e4}'
