function round(num) {
  return Math.round(num * 100) / 100;
}

function Tray(value, denom, label) {
  value *= 100;

  function kosher(val) {
    val = val ? round(val) : 0;
    if ((value + val) < 0) throw Error(label + ' empty tray: ' + val / 100);
    if (val % denom) throw Error(label + ' bad denomination: ' + val / 100);
    return Boolean(val);
  }
  function coerce(val) {
    if (!val) throw Error('no val to coerce');
    return Math.floor(val / denom) * denom;
  }
  this.value = function (val) {
    val = round (val * 100);
    if (kosher(val)) value += val;
    value = round(value);
    this._count = this.count();
    this._denom = denom;
    this._value = '$' + (value / 100).toFixed(2);
    return value / 100;
  };
  this.count = function (cnt) {
    var val = (cnt || 0) * denom;
    if (kosher(val)) value += val;
    return round(value / denom);
  };
  this.take = function (val) {
    val = round (val * 100);
    if (val < 0) throw Error('wanna give?');
    var real = Math.min(value, val);
    if (real > 0) {
      real = coerce(real) / 100;
      this.value(-real);
    }
    return real;
  };
  this.tallyFor = function () {
    return [label, value];
  };
  this.label = label;
}

function fillDrawer(arr) {
  var ord = [];
  arr.reverse().forEach(function (pair) {
    var str = pair[0];
    var val = pair[1];
    var den = lookup(str);
    ord.push(new Tray(val, den, str));
  });
  ord.get = function (due) {
    var i = 0, tray, got, rez = [];

    while (due && (tray = ord[i++])) {
      got = tray.take(due);
      due -= got;
      due = round(due);
      if (got) rez.push([tray.label, got]);
    }
    if (due) return 'Insufficient Funds';
    if (tray.value() === 0) return 'Closed';
    return rez;
  };
  return ord;
}

function checkCashRegister(price, cash, cid) {
